import React, {Component} from 'react';
import { withStore } from '../../store/store';
import { Route, Link }  from 'react-router-dom';
import classes from './ListMenu.module.css';

class ListMenu extends Component {


	setNewPath = () => {
		this.props.store.set("currentPath", window.location.pathname);
	}

	render(){

		let lists = this.props.store.listsMenu.map(el=>
			<li><Link onClick={this.setNewPath} to={el.path}>{el.title}</Link></li>
			)
		
		

		return(
			<div>
				<ul className={classes.listMenu}>
					{lists}
				</ul>
			</div>
			)
	}
}

export default withStore(ListMenu);
